import React from "react";
import Layout from "../components/layout/Layout";
import Drawer from "../components/layout/Drawer";
import { GlobalProvider } from "../context/global.context";

const App = () => {
  return (
    <GlobalProvider>
      <Drawer />
      <Layout>
        <div>Hello</div>
      </Layout>
    </GlobalProvider>
  );
};

export default App;
